import Link from 'next/link';

const index = ({currentUser,orders})=>{
    console.log('orders',orders);
    const tableContent = orders.map(t=>{
            return (
                <tr key={t.id}>
                    <td>{t.title}</td>
                    <td>{t.price}</td>
                    <td>
                    <Link href="/orders/[orderId]" as={`/orders/${t.id}`}>
                            <a className="nav-link">View</a>
                    </Link>
                    </td>
                </tr>
            );
        });



    return (
            <div>
                <h1>Your Orders</h1>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Title</th>
                            <th>Price</th>
                            <th>Link</th>
                        </tr>
                    </thead>
                    <tbody>
                        {tableContent}
                    </tbody>
                </table>
            </div>
        );
}; 



index.getInitialProps = async (context,client,currentUser)=>{
    const data = await client.get('/api/order/v1/get-orders');
    return {tickets:data.data.tickets};
}



export default index;
